import styled from 'styled-components';

export const LandContainer = styled.div`
  display: flex;

  > div {
    width: 100px;
    margin-right: 30px;
    cursor: pointer;

    > div.land-card-img {
      width: 100%;
      height: 100px;
      background-color: red;
    }

    > p {
      font-size: 8px;
      line-height: 10px;
    }
  }
`;
